import React from "react";
import "./Probando.scss";

const Probando = () => {
  return (
    <div className="grid">
      <p className="probandocssh">
        Correr es un proceso complejo y coordinado que involucra a todo el
        cuerpo. Cada ser humano corre de una manera diferente, pero ciertos
        aspectos son generales de los movimientos de carrera comunes. Las
        carreras a pie son competiciones de atletismo para determinar cuál de
        los competidores corre determinada distancia en el menor tiempo. Existen
        campeonatos mundiales de carreras a pie, entre ellos los Juegos
        Olímpicos y el Campeonato Mundial de Atletismo
      </p>
      <p className="probandocssh">
        Correr es un proceso complejo y coordinado que involucra a todo el
        cuerpo. Cada ser humano corre de una manera diferente, pero ciertos
        aspectos son generales de los movimientos de carrera comunes. Las
        carreras a pie son competiciones de atletismo para determinar cuál de
        los competidores corre determinada distancia en el menor tiempo. Existen
        campeonatos mundiales de carreras a pie, entre ellos los Juegos
        Olímpicos y el Campeonato Mundial de Atletismo
      </p>
    </div>
  );
};

export default Probando;
